import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import ResusersListScreen from './ResusersListScreen';
import ResusersDetailsScreen from './ResusersDetailsScreen';

const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="ResusersList" component={ResusersListScreen} />
        <Stack.Screen name="ResusersDetails" component={ResusersDetailsScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
export default App;
